on ul.list-style li{\\n\\t\\t\\t\\tbackground:url(..\\/modules\\/mod_btimagegallery\\/admin\\/images\\/tick.png) 0px 6px no-repeat;\\n\\t\\t\\t\\tpadding-left:30px;\\n\\t\\t\\t\\tline-height:15px;\\n\\t\\t\\t}\\n\\t\\t<\\/style>\\n\\t\\n\\t","group":""}', '{"moduleclass_sfx":"","jfolder_path":"images","get_limit":"20","sync_type":"none","sync_interval":"7","crop_image":"0","crop_width":"800","crop_height":"600","autoplay":"1","interval":"3000","duration":"500","pause_hover":"1","load_jquery":"1","responsive":"0","touchscreen":"0","module_width":"200","module_height":"300","number_of_cols":"2","number_of_rows":"3","thumbnail_width":"100","thumbnail_height":"100","image_margin":"2","show_bullet":"1","show_nav":"1","btnAutoplay":"0","autofancybox":"0","playspeed":"3500","animationeffect":"fade","show_helperbutton":"1","show_np":"0","slimbox_view":"1"}', '', '', 0, '0000-00-00 00:00:00', 0, 0),
