(10038, 'BT Portfolio Filter', 'module', 'mod_btportfolio_filter', '', 0, 1, 0, 0, '{"name":"BT Portfolio Filter","type":"module","creationDate":"November 2012","author":"BowThemes","copyright":"Copyright (C) 2012 Bowthemes. All rights reserved.","authorEmail":"support@bowthemes.com","authorUrl":"http:\\/\\/www.bowthemes.com","version":"1.0.1","description":"\\n\\t\\n\\t\\t<div class=\\"bt_description\\">\\n\\t\\t\\t<h3>BT Portfolio Filter Module Version 1.0.1<\\/h3>\\t\\t\\t\\n\\t\\t\\t<a href=\\"http:\\/\\/bowthemes.com\\" target=\\"_blank\\"><img src=\\"..\\/modules\\/mod_btportfolio_filter\\/admin\\/images\\/bt-filter.png\\"><\\/a>\\n\\t\\t\\t<p>BT Portfolio Filter modude is an amazing module to search and filter portfolio . It also allows to create filters for user with content of those from back-end, and  fully configure  with many options. <\\/p>\\n\\t\\t\\t<br clear=\\"both\\" \\/>\\n\\t\\t\\t<h3>Features<\\/h3>\\n\\t\\t\\t<ul class=\\"list-style\\">\\n\\t\\t\\t\\t<li>Search portfolio of component Portfolio<\\/li>\\n\\t\\t\\t\\t<li>Support for search keyword based on title, content<\\/li>\\n\\t\\t\\t\\t<li>Support for search by extra field<\\/li>\\n\\t\\t\\t\\t<li>Compatibility with Joomla 1.6 Joomla 1.7 & Joomla 2.5<\\/li>\\n\\t\\t\\t\\t<li>Cross Browser Support: IE7+, Firefox 2+, Safari 3+, Chrome 8+, Opera 9+<\\/li>\\n\\t\\t\\t<\\/ul>\\n\\t\\t\\t<h3>Upgrade versions<\\/h3>\\n\\t\\t\\t<p>\\n\\t\\t\\t\\tYour current versions is 1.0.1 <a target=\\"_blank\\" href=\\"http:\\/\\/bowthemes.com\\/\\">Find our latest versions now<\\/a>\\n\\t\\t\\t<\\/p>\\t\\t\\t\\n\\t\\t\\t<h3>About bow themes & copyright<\\/h3>\\t\\n\\t\\t\\t<p>\\n\\t\\t\\t\\tBow Themes is Professional Joomla template provider. We are focused on creating unique, attractive and clean templates without loosing flexibility and simplicity of customization\\n\\t\\t\\t<\\/p>\\n\\t\\t\\tCopyright (C) 2013 BowThemes\\t\\n\\n\\t\\t<\\/div>\\n\\t\\t<style>\\n\\t\\t\\t.bt_description h3{\\n\\t\\t\\t\\ttext-