(1, 'Melbourne takes mantle as most popular destination', 'melbourne-takes-mantle-as-most-popular-destination', 1, 1, '<p>Melbourne emerged as Australia''s most popular destination for domestic travellers in 2013 and has taken the mantle from Sydney, which is battling perceptions it is too expensive, according to a new survey.</p>\r\n', '\r\n<p>The 2013 Hotel Price Index (HPI) put the Victorian capital on top last year, with Sydney dropping to second place, Gold Coast third and Cairns fourth.</p>\r\n<p>Adelaide rose three places to fifth, ahead of Perth, Brisbane and Port Douglas.</p>\r\n<p>Darwin and Canberra rounded out the top 10.</p>', NULL, NULL, '[]', '', '2013-04-09 10:16:47', 42, '', 0, '0000-00-00 00:00:00', '2013-04-12 08:47:34', 42, '2013-04-09 10:16:47', '0000-00-00 00:00:00', 0, 1, 1, 0, 1, '', '', '', '', 5, '{"catItemTitle":"","catItemTitleLinked":"","catItemFeaturedNotice":"","catItemAuthor":"","catItemDateCreated":"","catItemRating":"","catItemImage":"","catItemIntroText":"","catItemExtraFields":"","catItemHits":"","catItemCategory":"","catItemTags":"","catItemAttachments":"","catItemAttachmentsCounter":"","catItemVideo":"","catItemVideoWidth":"","catItemVideoHeight":"","catItemAudioWidth":"","catItemAudioHeight":"","catItemVideoAutoPlay":"","catItemImageGallery":"","catItemDateModified":"","catItemReadMore":"","catItemCommentsAnchor":"","catItemK2Plugins":"","itemDateCreated":"","itemTitle":"","itemFeaturedNotice":"","itemAuthor":"","itemFontResizer":"","itemPrintButton":"","itemEmailButton":"","itemSocialButton":"","itemVideoAnchor":"","itemImageGalleryAnchor":"","itemCommentsAnchor":"","itemRating":"","itemImage":"","itemImgSize":"","itemImageMainCaption":"","itemImageMainCredits":"","itemIntroText":"","itemFullText":"","itemExtraFields":"","itemDateModified":"","itemHits":"","itemCategory":"","itemTags":"","itemAttachments":"","itemAttachmentsCounter":"","itemVideo":"","itemVideoWidth":"","itemVideoHeight":"","itemAudioWidth":"","itemAudioHeight