(2, '206/181 St Kilda Road St Kilda', '206-181-st-kilda-road-st-kilda', 1, 1, '<p>The huge terrace (12sqm) that accompanies this contemporary single-bedder creates an outstanding environment of indoor-outdoor comfort.</p>\r\n', '\r\n<p><span style="line-height: 1.3em;">Quietly set at the rear of the block amid St Kilda''s dynamic lifestyle precinct, the apartment maximises its spacious layout with open living/dining &amp; a quality kitchen equipped with stone benchtops, dishwasher, pull-out pantry &amp; a stylish custom-built timber island unit providing handy preparation &amp; storage space, mirrored robes &amp; shelves in the bedroom, separate designer bathroom, Euro laundry, reverse-cycle air conditioner, two Foxtel points &amp; video-monitored security. One day all apartments will be designed this way.</span></p>', NULL, NULL, '[]', '', '2013-04-09 10:20:33', 42, '', 0, '0000-00-00 00:00:00', '2013-04-12 03:41:42', 42, '2013-04-09 10:20:33', '0000-00-00 00:00:00', 0, 1, 3, 0, 3, '', '', '', '', 44, '{"catItemTitle":"","catItemTitleLinked":"","catItemFeaturedNotice":"","catItemAuthor":"","catItemDateCreated":"","catItemRating":"","catItemImage":"","catItemIntroText":"","catItemExtraFields":"","catItemHits":"","catItemCategory":"","catItemTags":"","catItemAttachments":"","catItemAttachmentsCounter":"","catItemVideo":"","catItemVideoWidth":"","catItemVideoHeight":"","catItemAudioWidth":"","catItemAudioHeight":"","catItemVideoAutoPlay":"","catItemImageGallery":"","catItemDateModified":"","catItemReadMore":"","catItemCommentsAnchor":"","catItemK2Plugins":"","itemDateCreated":"","itemTitle":"","itemFeaturedNotice":"","itemAuthor":"","itemFontResizer":"","itemPrintButton":"","itemEmailButton":"","itemSocialButton":"","itemVideoAnchor":"","itemImageGalleryAnchor":"","itemCommentsAnchor":"","itemRating":"","itemImage":"","itemImgSize":"","itemImageMainCaption":"","itemImageMainCredits":"","itemIntroText":"","itemFullText":"","itemExtraFields":"","itemDateModified":"","it