(10, 'Interior of modern living room of luxury villa', 'interior-of-modern-living-room-of-luxury-villa', 1, 1, '<p>Melbourne emerged as Australia''s most popular destination for domestic travellers in 2013 and has taken the mantle from Sydney, which is battling perceptions it is too expensive, according to a new survey.</p>\r\n', '\r\n<p>The 2013 Hotel Price Index (HPI) put the Victorian capital on top last year, with Sydney dropping to second place, Gold Coast third and Cairns fourth.</p>\r\n<p>Adelaide rose three places to fifth, ahead of Perth, Brisbane and Port Douglas.</p>\r\n<p>Darwin and Canberra rounded out the top 10.</p>\r\n<p></p>', NULL, NULL, '[]', '', '2013-04-10 08:25:53', 42, '', 42, '2013-04-17 09:12:24', '2013-04-16 02:10:14', 42, '2013-04-09 10:16:47', '0000-00-00 00:00:00', 0, 1, 2, 0, 2, '', '', '', '', 73, '{"catItemTitle":"","catItemTitleLinked":"","catItemFeaturedNotice":"","catItemAuthor":"","catItemDateCreated":"","catItemRating":"","catItemImage":"","catItemIntroText":"","catItemExtraFields":"","catItemHits":"","catItemCategory":"","catItemTags":"","catItemAttachments":"","catItemAttachmentsCounter":"","catItemVideo":"","catItemVideoWidth":"","catItemVideoHeight":"","catItemAudioWidth":"","catItemAudioHeight":"","catItemVideoAutoPlay":"","catItemImageGallery":"","catItemDateModified":"","catItemReadMore":"","catItemCommentsAnchor":"","catItemK2Plugins":"","itemDateCreated":"","itemTitle":"","itemFeaturedNotice":"","itemAuthor":"","itemFontResizer":"","itemPrintButton":"","itemEmailButton":"","itemSocialButton":"","itemVideoAnchor":"","itemImageGalleryAnchor":"","itemCommentsAnchor":"","itemRating":"","itemImage":"","itemImgSize":"","itemImageMainCaption":"","itemImageMainCredits":"","itemIntroText":"","itemFullText":"","itemExtraFields":"","itemDateModified":"","itemHits":"","itemCategory":"","itemTags":"","itemAttachments":"","itemAttachmentsCounter":"","itemVideo":"","itemVideoWidth":"","itemVideoHeight":"","itemAudioWidth":"","itemAudio