(65, 0, 'T3 Features', '', '<h1>Why choose T3?</h1>\r\n<p>6 years in Joomla! Development CAN''T be wrong!</p>\r\n<div class="row">\r\n<div class="span3" data-tablet="span6">\r\n<p><img src="images/joomlart/banners/responsive-icon.png" alt="Reposive" /></p>\r\n<h2>Responsive</h2>\r\n<p>Experience the power of Responsive Design, which does not only look good on all browsers and devices but also works like a charm!</p>\r\n</div>\r\n<div class="span3" data-tablet="span6">\r\n<p><img src="images/joomlart/banners/html5-icon.png" alt="Resposive" /></p>\r\n<h2>HTML5</h2>\r\n<p>Stepping stone to ensure your web experience and visualization quality that benefits from rich markup and compatibility.</p>\r\n</div>\r\n<div class="span3" data-tablet="span6 spanfirst">\r\n<p><img src="images/joomlart/banners/bootstrap-icon.png" alt="Bootstrap" /></p>\r\n<h2>Bootstrap</h2>\r\n<p>Integrated in full features and components from Bootstrap to standardize your grid, typography, and modules with less efforts.</p>\r\n</div>\r\n<div class="span3" data-tablet="span6">\r\n<p><img src="images/joomlart/banners/seo-icon.png" alt="SEO" /></p>\r\n<h2>SEO</h2>\r\n<p>Great design impresses your visitors, but SEO friendly codes bring visitors, drive more <a href="http://www.google.com" target="_blank">Googlers</a> to yours while you''re sleeping.</p>\r\n</div>\r\n</div>', 1, 'home-3', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', -2, 'mod_custom', 1, 0, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, '*'),
