(98, 0, 'T3 Introduction', '', '<p><img src="images/joomlart/banners/t3-banner.png" alt="T3 Framework" /></p>\r\n<div class="row">\r\n<div class="span4" data-tablet="span12 spanfirst">\r\n<h2>The "All New" T3</h2>\r\n<p>Support the latest Joomla 3.0, T3v3 hits the beat with the brand-new look, design approach and incredibly powerful customization feature.</p>\r\n</div>\r\n<div class="span4" data-tablet="span12 spanfirst">\r\n<h2>User Centric Design</h2>\r\n<p>Sleek look, clean coding and elegant design make T3 a sophisticated and user-friendly theme, guarantee to catch the attention right on spot.</p>\r\n</div>\r\n<div class="span4" data-tablet="span12 spanfirst">\r\n<h2>Developer''s Freedom</h2>\r\n<p>Customize and style your theme in a click with the built-in tool developed for T3 only, cherish the endless flexibility it gives you.</p>\r\n</div>\r\n</div>', 1, 'home-2', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', -2, 'mod_custom', 1, 0, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, '*'),
